        nodeType.setElementId("otherelement");
        nodeType.setArchiveName("archive");
        nodeType.setArchiveVersion("1.0.0");
        nodeType.setTags(Lists.newArrayList(new Tag("icon", "my_icon")));
        alienDao.save(nodeType);

