        buf = new byte[9];

        DataInputStream bin = new DataInputStream(is);

        bin.readFully(buf, 0, 9);

        assertArrayEquals("ghijklmno".getBytes(utf8), buf);

        assertEquals(-1, is.read());

        assertEquals(-1, is.read(buf));

        assertEquals(0, is.available());
    },No Smells

